   "POST /column/getArticleList.html":{"isLeaf":"0","sectionName":"动态资讯","articleInfo":{"sectionCode":"news","title":"央行为降准降温 强调系统性金融风险底线","sectionName":"动态资讯","isRecommend":"0","isTop":"0","content":"<p style=\"margin-top: 10px; margin-bottom: 10px; font-family: &#39;Microsoft YaHei&#39;, arial; text-indent: 37px; color: rgb(102, 102, 102); white-space: normal; line-height: 24px;\"><span style=\"font-size: 19px; line-height: 28.5px; font-family: 仿宋; color: black;\">8</span><span style=\"font-size: 19px; line-height: 28.5px; font-family: 仿宋; color: black;\">月5日，中国人民银行发布第二季度货币政策执行报告。对于市场最关心的降息降准，在本次报告的专栏中，央行匠心独运地以保持资产负债表平衡的视角来解释货币政策的基本逻辑，表明央行对频繁降准的顾虑。<br/>&nbsp;&nbsp;&nbsp;&nbsp;</span></p><p style=\"margin-top: 10px; margin-bottom: 10px; font-family: &#39;Microsoft YaHei&#39;, arial; text-indent: 37px; color: rgb(102, 102, 102); white-space: normal; line-height: 24px;\"><span style=\"font-size: 19px; line-height: 28.5px; font-family: 仿宋; color: black;\">专栏表示，在资产负债表的视角下，央行只能通过增加其他负债或者减少资产来平衡降准带来的影响。而由于目前的宏观环境下，央行过增发央票、扩大现金投放等来扩大负债并不具有可操作性，降准引起的负债减少需要通过资产方的调整来平衡，2014年下半年以来就表现为资产方的外汇储备也相应减少。</span></p><div><span style=\"font-size: 19px; line-height: 28.5px; font-family: 仿宋; color: black;\"><br/></span></div><p><br/></p>","remark":"央行为降准降温 强调系统性金融风险底线","clicks":0,"createTime":1470647270000,"picPath":"/data/img/article/20160808/1608080698629713.jpg","url":"","deleteFlag":"0","uuid":"ae1eb443ddff45af9e60d29c4b14cc03","next":"11","previous":"222"},"articleList":{"page":1,"pageSize":3,"count":2,"totalPage":1,"sectionName":"动态资讯","rows":[{"sectionCode":"news","title":"央行为降准降温 强调系统性金融风险底线","sort":2,"isRecommend":"0","isTop":"0","content":"<p style=\"margin-top: 10px; margin-bottom: 10px; font-family: &#39;Microsoft YaHei&#39;, arial; text-indent: 37px; color: rgb(102, 102, 102); white-space: normal; line-height: 24px;\"><span style=\"font-size: 19px; line-height: 28.5px; font-family: 仿宋; color: black;\">8</span><span style=\"font-size: 19px; line-height: 28.5px; font-family: 仿宋; color: black;\">月5日，中国人民银行发布第二季度货币政策执行报告。对于市场最关心的降息降准，在本次报告的专栏中，央行匠心独运地以保持资产负债表平衡的视角来解释货币政策的基本逻辑，表明央行对频繁降准的顾虑。<br/>&nbsp;&nbsp;&nbsp;&nbsp;</span></p><p style=\"margin-top: 10px; margin-bottom: 10px; font-family: &#39;Microsoft YaHei&#39;, arial; text-indent: 37px; color: rgb(102, 102, 102); white-space: normal; line-height: 24px;\"><span style=\"font-size: 19px; line-height: 28.5px; font-family: 仿宋; color: black;\">专栏表示，在资产负债表的视角下，央行只能通过增加其他负债或者减少资产来平衡降准带来的影响。而由于目前的宏观环境下，央行过增发央票、扩大现金投放等来扩大负债并不具有可操作性，降准引起的负债减少需要通过资产方的调整来平衡，2014年下半年以来就表现为资产方的外汇储备也相应减少。</span></p><div><span style=\"font-size: 19px; line-height: 28.5px; font-family: 仿宋; color: black;\"><br/></span></div><p><br/></p>","remark":"央行为降准降温 强调系统性金融风险底线","clicks":0,"createTime":1470647270000,"picPath":"/data/img/article/20160808/1608080698629713.jpg","url":"","deleteFlag":"0","id":"ae1eb443ddff45af9e60d29c4b14cc03"},{"sectionCode":"news","title":"马云回击电子商务导致实体店不景气的质疑","sort":1,"isRecommend":"0","isTop":"0","content":"<span style=\"color: rgb(0, 0, 0); font-family: 仿宋; font-size: 19px; line-height: 28.5px; text-indent: 37px; white-space: normal;\">马云回应，失败者永远找借口，成功者永远找方法。如果说个别零售企业出问题，可能与我们有关系，如果大部分企业出问题，肯定不是我的责任。而是整个业态有问题，中国零售业今年的产值在36万亿到40万亿，我们阿里巴巴才3万亿，不可能打败整个零售业。电子商务不是今天才发展起来的，阿里巴巴做了17年，这些年来我参与的所有商业都在呼吁互联网和电子商务。记得1999年和2000年，我在不同的城市呼吁，没有人相信新的消费习惯和新的商业模式。所以，不是我们打败了谁，而是新的技术、新的年轻人、新的消费习惯。不是实体行业不好，一些企业发展的很好，比如华为、小米都很好。新的时代，如果你没有变革，你的竞争对手你都看不见，看不起，看不懂，跟不上，你就会落败。互联网根本没有打击传统制造业，打击的是落后的制造业、落后的制造者。以前竞争的可能是谁的集装箱多，但现在的竞争是谁的集装箱里可以装5000件不同的衣服。今天经济低迷绝对不等同于企业低迷，要少听“宏观党”的说法，多听客户、听员工的想法，从身边做起，从身边改起，把自己的企业做好。建议企业家们大胆地去尝试移动互联网，不要只把它当做一种工具，而要当成机会。</span><p><br/></p>","remark":"马云回击电子商务导致实体店不景气的质疑","clicks":0,"createTime":1470647229000,"picPath":"/data/img/article/20160808/1608080681092494.jpg","url":"","deleteFlag":"0","id":"b99762c2283a4472b25ab8b0876608c5"}],"firstResult":0}},

